import Head from 'next/head';
import React from 'react';
import styled from 'styled-components';

const HomePage = () => (
  <Wrapper>
    <Head>
      <title>Home | Cluster Universities</title>
    </Head>

    <Title>Cluster Universities App</Title>
  </Wrapper>
);

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 100vw;
  height: 100vh;
  padding: 5vh 10vh;
`;

const Title = styled.h1`
  margin-bottom: 20px;
  font-size: 32px;
`;

export default HomePage;
